import React, { Component } from 'react';

class Social extends Component {
    render() {
        return (
            <div className="social">
            {<a href="https://github.com/nicolaspinard" target="_blank"><i className="fab fa-github"></i></a>}
            {<a href="https://Linkedin.com/in/nicolaspinard" target="_blank"><i className="fab fa-linkedin-in"></i></a>}
            </div>
            )
        }
    }

export default Social
